(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([[9],{fd4f:function(e,a,t){"use strict";t.r(a);var n=function(){var e=this,a=e.$createElement,t=e._self._c||a;return t("div",{staticClass:"q-pa-md"},[t("q-splitter",{scopedSlots:e._u([{key:"before",fn:function(){return[t("q-tabs",{staticClass:"text-grey",attrs:{align:"left",vertical:"","active-color":"primary","indicator-color":"primary"},model:{value:e.tab,callback:function(a){e.tab=a},expression:"tab"}},e._l(e.tabs,(function(e){return t("q-tab",{key:e.id,staticStyle:{"justify-content":"initial"},attrs:{name:e.id,label:e.name}})})),1)]},proxy:!0},{key:"after",fn:function(){return[t("q-tab-panels",{attrs:{animated:"",swipeable:"",vertical:"","transition-prev":"jump-up","transition-next":"jump-up"},model:{value:e.tab,callback:function(a){e.tab=a},expression:"tab"}},[t("q-tab-panel",{key:"people",attrs:{name:"people"}},[t("q-markdown",{attrs:{src:e.markdown.people}})],1),t("q-tab-panel",{key:"session",attrs:{name:"session"}},[t("q-markdown",{attrs:{src:e.markdown.sessions}})],1)],1)]},proxy:!0}]),model:{value:e.splitterModel,callback:function(a){e.splitterModel=a},expression:"splitterModel"}})],1)},o=[],r="# Collectors\n\nThe team of Collectors were sent to Mandevrath to acertain whether it's secrets will be helpful to the Collector cause. The team includes two human Spectres (Avervand & Pastance), a Lacinum diplomat (Nabur), and two Orc guards (Oska & Torge).\n\n# Droids\n\nDroids have limited AI, and are not sentient like the Forged. They were used by the Gauld for menial labour, and many continue to serve a similar purpose today. The techniques used to create new Droids have been lost, so most Droids are heavily maintained pieces of machinery.\n\n## C3P-D0H\n\nAn alcohol distillery robot. Knows 6 millions forms of distillation.\n\n## J4R-J4R\n\nCreated as a child's mascot, but proved to be largely unpopular.\n\n## PT-117\n\nProfessor Tablet 117 is the size of piece of paper and is as thick as a book. This droid is powered by an Aether Shard, and contains a colour screen, speakers, microphone, and camera. It's stats are 18 INT, 10 WIS, 7 CHA. It speaks and understands Gauldish, Draconic, and Common. It can be programmed with up to 3 additional languages by undergoing a training process.\n\nPT-117 has hearing and sight of up to 18m, and has no will of it's own. Knows extensive information about Dragons, Vampires, Virology, and the Aetherdeck. This means it gets a +9 bonus to areas of it's expertise. PT-117 has a limited form of movement via in-built hoverjets.\n\n# Hentergrey Deserters (501st)\n\nThese Deserters were formally part of the Hentergrey 501st legion. The leader of the band is Perron Sebasté. The others are Cléon Evand, Haman Ulin, Bastin Golorbas, and Galeb Erren. They are all human.\n\n# Kobolds\n\nThe Kobolds are the half-dragon, half-gauld creations of the Mandevrath Science Team. They were subjected to experimentations that tested dragon-killing weapons.\n\nKobolds saved from Kruxas were Mudran (leader), Praba, Vinda, and Bamo.\n\n## Handeep\n\nHandeep is an undead Kobold that has the essence of a Specter about them. It seems that Handeep is channelling their Spectral abilities to effectively make them immortal. Handeep thirsts for revenge and retribution against the Vampires, and his ruthlessness invokes terror in the other Kobold since he will kill anything that get's in his way.\n\n# Mandevrath Science Team\n\n- Dr Vardus Sonorius (Project Lead). Assumed dead from Vampire attack. Creator of the Aetherdeck. Was seen as the father of the Kobold pantheon.\n- Chief Alexandros Maxim (Security). Died from Vampire attack. Was seen as a War god in the Kobold pantheon.\n- Dr Tullas Kobo (Geneticist). Assumed dead from Vampire attack. Creator of the Kobolds. Was seen as the Creation god in the Kobold pantheon.\n- Dr Yulius Cheaser (Biologist). Assumed dead from Vampire attack. Was seen as the Healing god in the Kobold pantheon.\n- Dr Pores Paxis (Arcanologist). Assumed dead from Vampire attack. Creator of anti-Dragon equipment. Was seen as the Magic god in the Kobold pantheon.\n- Dr Verdum Kruxas (Virulogist). Turned into a Vampire, killed by the party. Creator of the DRAVID disease. Was seen as the Death god in the Kobold pantheon.\n- Dr Drafus Malfium (DNA specialist). Actually a vampire, and is currently at large. Was seen as the purest form of evil in the Kobold pantheon.\n- Kornus Moixa (Animal Handler). Turned into a Vampire. A controversial part of the Kobold Pantheon, as was formally a Protector goddess but is now seen as a fallen God.",s="# Mandevrath Arc\n\n## Session 1: Mandevrath\n\nThe party arrive at Mandevrath, where they encounter some Hentegrey army deserters and spiders. They quickly defeated all enemies and interrogate the survivors, learning about the Collector's interest in Mandevrath.\n\n## Session 2: Droids\n\nThe party found themselves stuck in a room that eventually turned out to be a contamination cleansing process. They also discovered a few Droids which Raorik took an interest in.\n\n## Session 3: The Collectors\n\nThe Collectors finally arrived at Mandevrath, and bargained with the party for ownership of the facility. This resulted in battle, where the party barely won. The party entered the final room, discovering a special type of spider that could phase through walls.\n\n## Session 4: Mystery at Mandevrath\n\nRaorik, Bendris and Geliah ventured deep into Mandevrath to find out secrets within. There were strange happenings within the walls of the underground where it appeared to be a laboratory. Further investigations lead the group to discover an ancient base to find a way to battle the Dragon threat. The denizens of Mandevrath developed biological warfare to stem the tide of the Dragon forces. In doing so they developed various Dragon-themed weaponry and found ways to bend space and time in secret rooms to further their reach. The group found the last door holding something within and stand ready venture forth.\n\n## Session 5: Kruxas & Handeep\n\n## Session 6: Moixa and the Kobold City\n",i={name:"Sampaign",data:function(){return{splitterModel:20,tab:"people",tabs:[{id:"people",name:"Dramatis Personae"},{id:"session",name:"Sessions"}],markdown:{people:r,sessions:s}}}},d=i,l=t("2877"),h=t("8562"),p=t("429b"),c=t("7460"),u=t("adad"),m=t("823b"),b=t("eebe"),f=t.n(b),g=Object(l["a"])(d,n,o,!1,null,null,null);a["default"]=g.exports;f()(g,"components",{QSplitter:h["a"],QTabs:p["a"],QTab:c["a"],QTabPanels:u["a"],QTabPanel:m["a"]})}}]);